void binary_to_text(const char *binary_string) {
    int len = strlen(binary_string);
    char buffer[9]; // Temporary storage for each byte
    buffer[8] = '\0'; // Null-terminate for easy conversion

    // Iterate over the binary string in chunks of 8 bits
    for (int i = 0; i < len; i += 8) {
        strncpy(buffer, binary_string + i, 8); // Copy 8 bits to buffer
        int ascii_value = strtol(buffer, NULL, 2); // Convert binary to int
        printf("%c", (char)ascii_value); // Print corresponding ASCII character
    }
    printf("\n");
}

